import React from "react";
import { Link } from "react-router-dom";

const SaveTaskButton = () => {
  return (
    <React.Fragment>
      <Link
        to={`/editcv/${id}`}
        onClick={this.updateProfile.bind(this)}
        className=""
        style={this.state.certifications ? null : { pointerEvents: "none" }}
      >
        <i
          className="fas fa-plus-circle"
          style={this.state.certifications ? null : { color: "#dddddd" }}
        >
          {" "}
          Save
        </i>
      </Link>
    </React.Fragment>
  );
};

export default SaveTaskButton;
